INSERT INTO `rec_position` VALUES ('1', '3', '后台开发工程师', '后端', '17-22k', '南京', 'Java', '在校/应届', '五险一金', '岗位职责：\r\n公共平台组件开发', '任职要求：\r\n1)、2021年毕业，本科及以上学历，计算机相关专业，或非计算机相关专业（但业余自修过计算机专业的所有必修课），英语四级及以上；\r\n2)、对软件开发工作有富有热情，强悍的逻辑性和创造力，工作责任心强，喜欢研究新技术；\r\n3)、熟悉JAVA或者GO语言；\r\n4)、了解操作系统，网络编程；\r\n5)、有较强的自学能力，善于总结，有原创博客或开源应用者优先', '2021-03-28', '1', '1', '1436');
INSERT INTO `rec_position` VALUES ('2', '3', '前端工程师', '前端', '13-16K', '南京', 'js', '在校/应届', '年终奖', '岗位职责：\r\n公共平台组件开发', '任职要求：\r\n1)、2021年毕业，本科及以上学历，计算机相关专业，或非计算机相关专业（但业余自修过计算机专业的所有必修课），英语四级及以上；\r\n2)、对软件开发工作有富有热情，强悍的逻辑性和创造力，工作责任心强，喜欢研究新技术；\r\n3)、熟悉JAVA或者GO语言；\r\n4)、了解操作系统，网络编程；\r\n5)、有较强的自学能力，善于总结，有原创博客或开源应用者优先', '2021-03-28', '1', '1', '124');
INSERT INTO `rec_position` VALUES ('3', '3', '产品经理', '产品', '25-40K', '深圳', '不限', '3-5年经验  ', '带薪年假', '职位描述\n1、与公司内各个业务单元紧密链接，设计并落地中台智能商业能力，规划中台商业能力智能化建设方向。\n2、负责中台知识图谱建设和对外服务，打造面向人货场的商业知识体系，解决公司内各个体系对商业知识的需求以及中台商业能力建设。\n3、制定策略，协调部门及业务方持续改善策略效果和业务体验，提高决策效率。\n4、创新数据产品，让公司内的大数据能力创造商业价值。', '职位要求\n1、2年以上电商的广告/搜索/推荐/saas产品经验。对数据产品定位、发展方向有深入的理解和认识。\n2、具备良好的数据敏感度和业务视野，能够敏锐的捕获数据价值和产品机会。\n3、熟悉互联网或软件产品整体项目实现过程，包括从业务调研、需求分析到产品发布。\n4、了解底层数据的架构技术以及应用层数据分析和算法的基本概念，能够运用数据作为产品解决业务方及决策问题。\n5、具有电商系统或大数据系统的产品设计实战经验，执行力强，说到做到。\n6、积极的沟通能力，开阔的产业视野，能积极应对各种挫折和挑战的心理素质 。', '2021-03-28', '1', '6', '54');
INSERT INTO `rec_position` VALUES ('7', '3', '高级Java工程师', '后端', '15-30K', '南京', 'java', '3-5年经验  ', '六险一金', '工作职责:\n1、基于全文检索技术负责公司产品搜索开发工作；\n2、优化现有搜索系统架构\n3、负责搜索相关服务的持续优化与改进。', '任职资格:\n1、4年以上JAVA开发经验，有1年及以上的搜索相关的工作经验优先；\n2、熟悉电商平台关键字搜索技术；\n3、熟悉搜索引擎原理，精通搜索引擎相关知识（如分词，索引，关联词，权重排序等）；\n4、有良好的数据结构和算法功底\n5、熟悉应用服务器, 熟悉Tomcat、Netty、Apache的配置及其优化\n6、熟悉SOA、Messaging、Socket、线程、并发等开发知识，有后台框架开发经验\n7、熟悉lucene/Solr/Elasticsearch等，并有实际开发工作经验；\n8、工作态度积极，踏实肯干，沟通良好，有团队协作精神；\n9、有技术追求，愿意自我驱动主动研究学习。', '2021-03-28', '0', '1', '55');
INSERT INTO `rec_position` VALUES ('8', '3', '资深数据分析专员', '数据', ' 10-15k', '南京', '不限', '3-5年经验  ', '六险一金', '岗位要求：\n1、本科及以上学历，统计学、商科类专业优先，可接受应届生及有相关工作经验的候选人；\n2、应届生要求：有数据分析的实际项目或实习经历，有良好的数据敏感性和逻辑思维能力；\n3、非应届生要求：有3年左右数据分析相关工作经历，客服相关数据分析经历优先；\n4、熟悉SQL语句/Python/Tableau等工具使用方法。', '岗位职责：\n1、结合对客户服务部门的理解，搭建部门数据分析框架，提高数据呈现可视化程度；能够灵活选择分析方法分析数据，得出综合分析报告，为业务提供专业建议；\n2、通过分析内部业务数据走向，对业务发展趋势进行预测；3、及时发现数据异常状况，并进行数据修复；\n4、主动、持续学习各种新的数据分析知识、方法、工具并应用于数据分析工作中。', '2021-03-28', '1', '3', '212');
INSERT INTO `rec_position` VALUES ('9', '3', '高级E-HR产品经理', '产品 ', '20-30K', '广州', '不限', '5-10年经验  ', '补充医疗保险', '任职资格：\n1、统招本科及以上学历；\n2、有流程、OA、人力资源管理的实施经验或咨询公司工作背景； 参与过企业流程优化、信息化系统建设，对OA和eHR相关模块有深入的了解；\n3、3年以上大型系统实施经验，熟悉泛微OA系统者优先；\n4、较强的逻辑思维能力、分析解决问题的能力，擅长数据分析和需求调研，较强的口头和文字表达能力；\n5、熟悉互联网产品研发工作流程，有产品规划、设计经验。', '岗位职责：\n1、负责公司OA和eHR相关产品规划、落地实施，推进业务调研、需求分析；\n2、负责企业OA和eHR系统市场调研、需求分析、原型设计及产品生命周期管理，分析学习同行业系统管理经验，跟踪最新发展趋势，持续改进；\n3、进行项目管理，和业务、设计、技术及测试部门合作，保证产品从概念设计到开发到上线的如期顺利完成；\n4、协调开发、测试团队理解和掌握需求，对产品需求实现和易用性负责；\n5、分析OA和eHR系统各项数据及用户反馈，分析产品运营效果、用户使用行为，搜集运营中产生的功能需求，综合各部门的意见和建议，持续优化改进产品；\n6、负责面向内部或外部的正式场合培训用户或内部产品经理之间的知识转移和传递工作；\n7、负责所管理项目的文档建设工作和知识沉淀工作。', '2021-03-28', '1', '6', '2');
INSERT INTO `rec_position` VALUES ('10', '3', '全栈开发/软件工程师', '后端', '2-5K', '沈阳', '不限', '  无工作经验  ', '', '\n 一、职位描述 根据公司业务发展需要, 负责相关系统的开发, 优化和维护工作。 二、应聘条件 1．中国国籍，户籍不限 2．35岁以下 3．本科及以上学历，计算机科学、信息系统等相关专业 4. 熟悉Visual Basic, PHP等 5. 熟练掌握ORACLE, MYSQL数据库 6. 能熟练应用Jquery, JS, CSS, D3等 (具有前后端全栈能力者优先) 7. 正直认真, 善于思考, 学习能力强 \n', '\n 一、职位描述 根据公司业务发展需要, 负责相关系统的开发, 优化和维护工作。 二、应聘条件 1．中国国籍，户籍不限 2．35岁以下 3．本科及以上学历，计算机科学、信息系统等相关专业 4. 熟悉Visual Basic, PHP等 5. 熟练掌握ORACLE, MYSQL数据库 6. 能熟练应用Jquery, JS, CSS, D3等 (具有前后端全栈能力者优先) 7. 正直认真, 善于思考, 学习能力强 \n', '2021-04-01', '1', '1', '38');
INSERT INTO `rec_position` VALUES ('11', '3', 'Matlab/Simulink软件工程师 ，汽车电子研发', '嵌入式', '10-25k', '上海', '不限', '  2年经验  ', '五险一金\n餐饮补贴\n通讯补贴\n专业培训\n绩效奖金\n年终奖金', '\nSoftware design including model based algorithm software development, coding, HLD & LLD level documentation. Software tests including strategy, unit tests, debugging & documentation. It is focused on the model-based development method over modeling, simulation, testing and the embedding into the software structure.模型开发软件工程师采用Model-based-Design方式，依据V模型开发流程，使用Matlab进行建模，仿真，测试。通过code generation生成自动代码，并把代码集成到嵌入式软件代码中。1．Job Description 岗位职责Starting from the functional description, to setup the modeling, simulation and functional tests with the Matlab/Simulink/Stateflow tool.To be the expert for the automatic code generation and the embedding of the generated code block into the software system.Software Quality Management: Module tests implementation with full coverage依据电子产品的功能规范，使用Matlab/Simulink/Stateflow进行建模，仿真，并进行单元测试。对模型进行自动代码生成，并把代码集成到产品的软件代码中。根据测试需求，建立测试模型，用以验证测试其他产品或者模块。2．Job Requirements: 岗位要求Well experienced in the model-based automotive software development environment with Matlab/Simulink/StateflowFamiliar with the automatic code generation, as well as the script.Familiar with the C programming for the embedded systems.Familiar with the code integration for the target software.Automotive communication protocol experience for I2C, SPI, CAN, LINExperience with CANoe & Vehicle SPY3 is preferred熟悉Matlab/Simulink/Stateflow建模开发及仿真测试，熟悉V模型开发流程。熟悉自动代码生成，能够编写或者配置自动代码生成脚本。熟悉汽车电子产品嵌入式系统C语言编程，能够对生成的代码进行修改配置，并集成于产品代码中。了解汽车电子行业的单片机，如Freescale，ST，Renesas厂家的MCU。了解CAN网络，有CANoe或者Vehicle SPY3使用经验者优先。Bachelor degree or above, 2+ years of working experienceGood skills in communication, management experience, work in the bilingual international team and willingness of business travel domestic and internationalOpen minded, strong personal engagement and the active team spirit is highly appreciated本科以上学历，2年以上工作经历具有良好的沟通，管理能力和经验，适应英、汉双语工作环境，适应国际／国内出差旅行具备勤劳开朗，努力向上和主动的团队精神\n', '\nSoftware design including model based algorithm software development, coding, HLD & LLD level documentation. Software tests including strategy, unit tests, debugging & documentation. It is focused on the model-based development method over modeling, simulation, testing and the embedding into the software structure.模型开发软件工程师采用Model-based-Design方式，依据V模型开发流程，使用Matlab进行建模，仿真，测试。通过code generation生成自动代码，并把代码集成到嵌入式软件代码中。1．Job Description 岗位职责Starting from the functional description, to setup the modeling, simulation and functional tests with the Matlab/Simulink/Stateflow tool.To be the expert for the automatic code generation and the embedding of the generated code block into the software system.Software Quality Management: Module tests implementation with full coverage依据电子产品的功能规范，使用Matlab/Simulink/Stateflow进行建模，仿真，并进行单元测试。对模型进行自动代码生成，并把代码集成到产品的软件代码中。根据测试需求，建立测试模型，用以验证测试其他产品或者模块。2．Job Requirements: 岗位要求Well experienced in the model-based automotive software development environment with Matlab/Simulink/StateflowFamiliar with the automatic code generation, as well as the script.Familiar with the C programming for the embedded systems.Familiar with the code integration for the target software.Automotive communication protocol experience for I2C, SPI, CAN, LINExperience with CANoe & Vehicle SPY3 is preferred熟悉Matlab/Simulink/Stateflow建模开发及仿真测试，熟悉V模型开发流程。熟悉自动代码生成，能够编写或者配置自动代码生成脚本。熟悉汽车电子产品嵌入式系统C语言编程，能够对生成的代码进行修改配置，并集成于产品代码中。了解汽车电子行业的单片机，如Freescale，ST，Renesas厂家的MCU。了解CAN网络，有CANoe或者Vehicle SPY3使用经验者优先。Bachelor degree or above, 2+ years of working experienceGood skills in communication, management experience, work in the bilingual international team and willingness of business travel domestic and internationalOpen minded, strong personal engagement and the active team spirit is highly appreciated本科以上学历，2年以上工作经历具有良好的沟通，管理能力和经验，适应英、汉双语工作环境，适应国际／国内出差旅行具备勤劳开朗，努力向上和主动的团队精神\n', '2021-04-01', '1', '1', '877');
INSERT INTO `rec_position` VALUES ('12', '3', '嵌入式软件工程师', '嵌入式', '2-5K', '济南', '不限', '  1年经验  ', '做五休二\n带薪年假\n五险一金\n包住宿\n节日福利\n全勤奖\n加班补贴\n绩效奖金\n提供个人体检\n提供父母体检', '\n1、按项目要求，完成软件方案说明文档，通讯协议文档，嵌入式软件源代码编写2、根据客户需求和行业理解，对公司平台各主板及模块的软件功能维护及升级。 3、和产品/项目沟通需求，协同处理软硬件开发任务的分解和进度跟进。 任职要求: 1、熟练使用 C/C++语言，并具备良好的代码与文档风格。2、熟练至少一种 rtos 嵌入式操作系统 3、熟悉模电，数电及嵌入式系统的设计原理，有一定的硬件开发和设计能力 4、有一定的算法经验，熟悉常用的直流，编码，步进，舵机等电机的控制。 5、熟悉各种常见传感器的应用及驱动，熟悉I2C、SPI、UART、单总线等接口 6、良好的表达能力、团队合作精神和创新能力 7、熟悉wifi，蓝牙，zigbee，2.4G等无线模块的通信原理及开发的优先 8、大学期间或者工作期间，参加过各种机器人比赛或者电子设计大赛的优先 9、掌握linux驱动开发和python语言的优先\n', '\n1、按项目要求，完成软件方案说明文档，通讯协议文档，嵌入式软件源代码编写2、根据客户需求和行业理解，对公司平台各主板及模块的软件功能维护及升级。 3、和产品/项目沟通需求，协同处理软硬件开发任务的分解和进度跟进。 任职要求: 1、熟练使用 C/C++语言，并具备良好的代码与文档风格。2、熟练至少一种 rtos 嵌入式操作系统 3、熟悉模电，数电及嵌入式系统的设计原理，有一定的硬件开发和设计能力 4、有一定的算法经验，熟悉常用的直流，编码，步进，舵机等电机的控制。 5、熟悉各种常见传感器的应用及驱动，熟悉I2C、SPI、UART、单总线等接口 6、良好的表达能力、团队合作精神和创新能力 7、熟悉wifi，蓝牙，zigbee，2.4G等无线模块的通信原理及开发的优先 8、大学期间或者工作期间，参加过各种机器人比赛或者电子设计大赛的优先 9、掌握linux驱动开发和python语言的优先\n', '2021-04-01', '1', '1', '271');
INSERT INTO `rec_position` VALUES ('13', '3', '软件工程师', '后端', '7-12K', '苏州', '不限', '  2年经验  ', '五险一金\n员工旅游\n餐饮补贴\n绩效奖金\n年终奖金', '\n岗位职责：1、机器人应用相关的上位机软件开发，包括软件界面的开发，相关算法的开发以及与机器人的通讯协议的撰写；2、通信类设备软件的上位机开发；3、互联互通的MES软件开发。任职要求：1、全日制本科及以上学历；2、熟练使用C#或C++或python；3、能够独立进行工业上位机软件设计；4、对PCL熟悉者优先；5、年龄32周岁以下。\n', '\n岗位职责：1、机器人应用相关的上位机软件开发，包括软件界面的开发，相关算法的开发以及与机器人的通讯协议的撰写；2、通信类设备软件的上位机开发；3、互联互通的MES软件开发。任职要求：1、全日制本科及以上学历；2、熟练使用C#或C++或python；3、能够独立进行工业上位机软件设计；4、对PCL熟悉者优先；5、年龄32周岁以下。\n', '2021-04-01', '0', '1', '746');
INSERT INTO `rec_position` VALUES ('14', '3', 'web前端高级软件工程师（急聘）', '嵌入式', '12-16k', '上海', '不限', '  3-4年经验  ', '五险一金\n餐饮补贴\n弹性工作', '\n岗位职责： 1、利用web相关技术开发系统应用； 2、实现产品经理提出的交互需求； 3、提出最优的前端技术解决方案，规范页面代码，优化页面加载性能； 4、协同其他技术部门，做前端开发技术支持，精通JS，会切图。 任职资格： 1、计算机或相关专业专科以上学历，3年以上前端开发经验，有同时处理PC及移动端前端页面的能力，从事过交互设计岗位的优先考虑。 2、熟悉HTML、JavaScript、JQUERY、CSS3、JS，vue可以独立完成页面的动态交互和布局美化； 3、对前端性能优化、解决多浏览器兼容性问题有丰富的经验和案例； 4、对WEB前端开发经验，有网站开发经验优先； 5、对用户体验、交互操作流程、及用户需求有一定了解，有独立的审美观。\n', '\n岗位职责： 1、利用web相关技术开发系统应用； 2、实现产品经理提出的交互需求； 3、提出最优的前端技术解决方案，规范页面代码，优化页面加载性能； 4、协同其他技术部门，做前端开发技术支持，精通JS，会切图。 任职资格： 1、计算机或相关专业专科以上学历，3年以上前端开发经验，有同时处理PC及移动端前端页面的能力，从事过交互设计岗位的优先考虑。 2、熟悉HTML、JavaScript、JQUERY、CSS3、JS，vue可以独立完成页面的动态交互和布局美化； 3、对前端性能优化、解决多浏览器兼容性问题有丰富的经验和案例； 4、对WEB前端开发经验，有网站开发经验优先； 5、对用户体验、交互操作流程、及用户需求有一定了解，有独立的审美观。\n', '2021-04-01', '1', '1', '726');
INSERT INTO `rec_position` VALUES ('15', '3', '电气软件工程师', '嵌入式', '15-25k', '上海', '不限', '  3-4年经验  ', '五险一金\n餐饮补贴\n定期体检\n通讯补贴\n年终奖金\n员工旅游\n提供住宿\n绩效奖金\n免费班车\n14薪', '\n电气软件工程师岗位要求1. 能够熟练应用C#,C++等进行自动化机器上位界面的开发制作。2. 能够熟练PLC，运动控制卡等，进行自动化机器运动控制的开发制作。3. 能够完成自动化机器电控系统的设计，包括整套电气硬件选型，电路图制图，软件编写。4. 掌握伺服电机，步进电机，直线电机等各式电机的控制。5. 熟悉工业机器人的应用，包括四轴Scara机器人，六轴机器人者优先。6. 有机器视觉或MES相关项目经验者优先。7. 有AGV相关项目经验者优先。 基本要求：1. 本科及以上学历，自动化、机电一体化或计算机软件等相关专业。2. 3年以上自动化设备研发经验。3. 具备独立制作自动化机器的能力，具备良好的沟通能力和协作能力。公司提供单身宿舍。\n', '\n电气软件工程师岗位要求1. 能够熟练应用C#,C++等进行自动化机器上位界面的开发制作。2. 能够熟练PLC，运动控制卡等，进行自动化机器运动控制的开发制作。3. 能够完成自动化机器电控系统的设计，包括整套电气硬件选型，电路图制图，软件编写。4. 掌握伺服电机，步进电机，直线电机等各式电机的控制。5. 熟悉工业机器人的应用，包括四轴Scara机器人，六轴机器人者优先。6. 有机器视觉或MES相关项目经验者优先。7. 有AGV相关项目经验者优先。 基本要求：1. 本科及以上学历，自动化、机电一体化或计算机软件等相关专业。2. 3年以上自动化设备研发经验。3. 具备独立制作自动化机器的能力，具备良好的沟通能力和协作能力。公司提供单身宿舍。\n', '2021-04-01', '1', '1', '1726');
