INSERT INTO `rec_position` VALUES ('17', '3', '嵌入式软件工程师', '嵌入式', '5-8K', '长沙', '不限', '  1年经验  ', '五险一金\n员工旅游\n交通补贴\n股票期权\n年终奖金\n专业培训\n定期体检\n周末双休\n带薪年假\n节假日福利', '\n岗位职责：1、熟悉软件开发流程；2、参与需求和设计讨论，对项目开发各个环节进行签字确认；3、负责与需求人员接口，熟悉项目的需求规划说明；4、负责与项目负责人接口，熟悉项目的开发计划及项目的概要设计；5、根据公司技术文档规范编写相关的技术文档；6、按计划完成功能模块的功能设计、代码实现、代码编写和单元测试，并提交测试人员进行功能测试；7、严格遵守相关开发工具的编码规范；8、负责对应用方案系列产品进行维护和持续升级； 9、参与技术难题攻关、组织技术积累，相关技术培训等工作。岗位要求：1、通信、计算机、软件工程等相关专业，大学本科及以上学历；2、熟悉VxWorks或Linux下OpenGL、OpenGL   ES开发；3、熟练掌握OpenGL、QT等嵌入式应用开发；4、熟悉3D图形原理，熟悉3D几何，具备算法和数学基础，良好的编码习惯和学习能力；5、熟悉linux常见设备驱动的开发移植工作等。6、具备良好的沟通能力和团队合作精神；7、熟悉显示驱动控制芯片（联咏、奇景、瑞昱及凌阳等）软件开发的优先。\n', '\n岗位职责：1、熟悉软件开发流程；2、参与需求和设计讨论，对项目开发各个环节进行签字确认；3、负责与需求人员接口，熟悉项目的需求规划说明；4、负责与项目负责人接口，熟悉项目的开发计划及项目的概要设计；5、根据公司技术文档规范编写相关的技术文档；6、按计划完成功能模块的功能设计、代码实现、代码编写和单元测试，并提交测试人员进行功能测试；7、严格遵守相关开发工具的编码规范；8、负责对应用方案系列产品进行维护和持续升级； 9、参与技术难题攻关、组织技术积累，相关技术培训等工作。岗位要求：1、通信、计算机、软件工程等相关专业，大学本科及以上学历；2、熟悉VxWorks或Linux下OpenGL、OpenGL   ES开发；3、熟练掌握OpenGL、QT等嵌入式应用开发；4、熟悉3D图形原理，熟悉3D几何，具备算法和数学基础，良好的编码习惯和学习能力；5、熟悉linux常见设备驱动的开发移植工作等。6、具备良好的沟通能力和团队合作精神；7、熟悉显示驱动控制芯片（联咏、奇景、瑞昱及凌阳等）软件开发的优先。\n', '2021-04-01', '1', '1', '788');
