INSERT INTO `rec_position` VALUES ('22', '3', '软件工程师', '前端', '13-16K', '江门', '不限', '  2年经验  ', '五险一金\n包吃\n包住宿', '\n岗位职责：1. 车载嵌入式产品的软件开发调试。 2. 制定软件单元测试工作的计划并执行完成。 3. 集成测试产生的问题处理及软件维护。 4. 负责相关设计文档的编写整理以及归档。 5.支持软件项目负责人在日常技术问题上的工作。任职要求：1. 电子、通信、自动化或计算机类相关专业，本科或以上学历，半年以上嵌入式软件开发工作经验，优秀毕业生亦可以考虑。2. 熟练掌握C/C++语言基本语法，具备基本嵌入式软件调试经验，熟练掌握至少一种开发调试工具链或IDE集成开发调试环境。3. 熟练使用万用表仿真器等常用工具，能够通过仿真器、串口终端等基本手段解决软件开发中的常见问题。4. 了解嵌入式软件开发过程，了解嵌入式实时操作系统基本原理。5. 熟悉单片机GPIO、SPI、IIC、UART、USB等基本外设，了解CAN、MODBUS等相关工业协议。具备一定的英语阅读能力。优先资格：1． 有汽车嵌入式软件开发经验者优先。 2． 具备DSP开发或者移植调试经验者优先。 3． 熟悉MATLAB或python仿真计算者优先。 4. 熟悉Linux基本驱动开发调试者优先考虑。\n', '\n岗位职责：1. 车载嵌入式产品的软件开发调试。 2. 制定软件单元测试工作的计划并执行完成。 3. 集成测试产生的问题处理及软件维护。 4. 负责相关设计文档的编写整理以及归档。 5.支持软件项目负责人在日常技术问题上的工作。任职要求：1. 电子、通信、自动化或计算机类相关专业，本科或以上学历，半年以上嵌入式软件开发工作经验，优秀毕业生亦可以考虑。2. 熟练掌握C/C++语言基本语法，具备基本嵌入式软件调试经验，熟练掌握至少一种开发调试工具链或IDE集成开发调试环境。3. 熟练使用万用表仿真器等常用工具，能够通过仿真器、串口终端等基本手段解决软件开发中的常见问题。4. 了解嵌入式软件开发过程，了解嵌入式实时操作系统基本原理。5. 熟悉单片机GPIO、SPI、IIC、UART、USB等基本外设，了解CAN、MODBUS等相关工业协议。具备一定的英语阅读能力。优先资格：1． 有汽车嵌入式软件开发经验者优先。 2． 具备DSP开发或者移植调试经验者优先。 3． 熟悉MATLAB或python仿真计算者优先。 4. 熟悉Linux基本驱动开发调试者优先考虑。\n', '2021-04-02', '1', '1', '524');
INSERT INTO `rec_position` VALUES ('23', '3', 'C# WPF软件工程师', '产品', '25-40K', '上海', '不限', '  1年经验  ', '做五休二\n周末双休\n带薪年假\n住房补贴\n五险一金\n节日福利\n绩效奖金', '\n工作内容及工作职责：理解产品SPEC和功能要求。开发平板探测器PC端应用软件UI。设计人机交互的界面软件以及根据客户要求定制界面。支持测试和验证部门以使产品顺利完成功能测试。协助本部门其他SW组进行软件开发，提供必要的帮助。及时提供输出文档，整理manual, 协议等相关文档。适时了解终端客户需求并提供技术支持。岗位资格要求：--本科及以上学历；计算机相关专业；  --具有2年以上相关工作经验；  --熟练掌握Visual Studio IDE下WPF C#编程，掌握MVVM编程框架；--掌握基本的软件算法，有图像方面编程经验的优先；--具有扎实的理论功底，技术全面，对技术有敏锐的洞察力，自学能力  --思路清晰，善于沟通，具备良好的判断和决策解决能力  --具有良好的团队协作开发能力 --基本的英语听/说和良好的读/写能力； \n', '\n工作内容及工作职责：理解产品SPEC和功能要求。开发平板探测器PC端应用软件UI。设计人机交互的界面软件以及根据客户要求定制界面。支持测试和验证部门以使产品顺利完成功能测试。协助本部门其他SW组进行软件开发，提供必要的帮助。及时提供输出文档，整理manual, 协议等相关文档。适时了解终端客户需求并提供技术支持。岗位资格要求：--本科及以上学历；计算机相关专业；  --具有2年以上相关工作经验；  --熟练掌握Visual Studio IDE下WPF C#编程，掌握MVVM编程框架；--掌握基本的软件算法，有图像方面编程经验的优先；--具有扎实的理论功底，技术全面，对技术有敏锐的洞察力，自学能力  --思路清晰，善于沟通，具备良好的判断和决策解决能力  --具有良好的团队协作开发能力 --基本的英语听/说和良好的读/写能力； \n', '2021-04-02', '1', '1', '491');
INSERT INTO `rec_position` VALUES ('24', '3', '软件工程师-应届毕业生招聘', '后端', '15-30K', '异地招聘', '不限', '  无工作经验  ', '', '\n岗位职责1、配合算法研究人员实现计算机视觉算法；2、对编写的程序进行严格单元测试，进行系统故障的诊断、定位、分析和调试；3、负责软件相关技术方案的编写；4、完成其它研发、项目工程等工作。职位要求1、硕士及以上学历，计算机、电子信息、光电信息等相关专业；2、具有两年及以上软件开发工作经验；3、精通C/C++编程语言，熟练使用Matlab语言；4、具备良好的计算机基础及编程习惯，具备独立编程的能力；5、思路清晰，思维敏捷，有良好的沟通能力和学习能力，具备团队意识；6、具有1年以上独立C++开发经验者优先；7、有图像处理软件/视觉软件开发经验者优先；8、 熟练使用OpenCV等工具库者优先。\n', '\n岗位职责1、配合算法研究人员实现计算机视觉算法；2、对编写的程序进行严格单元测试，进行系统故障的诊断、定位、分析和调试；3、负责软件相关技术方案的编写；4、完成其它研发、项目工程等工作。职位要求1、硕士及以上学历，计算机、电子信息、光电信息等相关专业；2、具有两年及以上软件开发工作经验；3、精通C/C++编程语言，熟练使用Matlab语言；4、具备良好的计算机基础及编程习惯，具备独立编程的能力；5、思路清晰，思维敏捷，有良好的沟通能力和学习能力，具备团队意识；6、具有1年以上独立C++开发经验者优先；7、有图像处理软件/视觉软件开发经验者优先；8、 熟练使用OpenCV等工具库者优先。\n', '2021-04-02', '1', '1', '883');
