INSERT INTO `rec_position` VALUES ('26', '3', 'PLC嵌入式软件工程师', '产品 ', '20-30K', '深圳', '不限', '  无工作经验  ', '五险一金\n年终奖金\n股票期权\n员工旅游\n定期体检\n专业培训\n免费班车\n餐饮补贴', '\n工作职责:1、PLC产品的嵌入式软件设计工作；2、现场总线相关主从站协议及配套功能开发和技术攻关工作；3、嵌入式软件和PLC产品的自测，解决自测问题和测试问题；4、硬件调测的协助，工装及制造相关的协助，以及相关的问题解决；5、市场反馈的问题处理，以及产品维护和优化工作；6、编写项目文档、质量文档以及其他有关文档，评审他人编写的技术文档；7、软件团队建设，新人培养，进行技术分享和经验案例分享。 任职资格:1. 精通嵌入式软件开发技能，熟悉ARM系统开发，掌握软件相关专业知识和业务流程，有良好的文档习惯；2. 精通现场总线协议相关开发，如Canopen，Profibus-DP，Ethercat，Profinet，熟悉现场总线相关的系统问题诊断和解耦；3. 有良好的英语阅读能力，能够阅读英文器件资料、标准资料和同行信息；4. 对基于OS开发的嵌入式系统有相关经验或认识；5. 有代码规范意识，工作严谨细致，有责任心，善于思考，有独立工作能力；6. 有良好沟通能力，具备团队合作精神；7. 熟练使用常用电子仪器设备，如万用表、示波器、信号发生器等； \n', '\n工作职责:1、PLC产品的嵌入式软件设计工作；2、现场总线相关主从站协议及配套功能开发和技术攻关工作；3、嵌入式软件和PLC产品的自测，解决自测问题和测试问题；4、硬件调测的协助，工装及制造相关的协助，以及相关的问题解决；5、市场反馈的问题处理，以及产品维护和优化工作；6、编写项目文档、质量文档以及其他有关文档，评审他人编写的技术文档；7、软件团队建设，新人培养，进行技术分享和经验案例分享。 任职资格:1. 精通嵌入式软件开发技能，熟悉ARM系统开发，掌握软件相关专业知识和业务流程，有良好的文档习惯；2. 精通现场总线协议相关开发，如Canopen，Profibus-DP，Ethercat，Profinet，熟悉现场总线相关的系统问题诊断和解耦；3. 有良好的英语阅读能力，能够阅读英文器件资料、标准资料和同行信息；4. 对基于OS开发的嵌入式系统有相关经验或认识；5. 有代码规范意识，工作严谨细致，有责任心，善于思考，有独立工作能力；6. 有良好沟通能力，具备团队合作精神；7. 熟练使用常用电子仪器设备，如万用表、示波器、信号发生器等； \n', '2021-04-03', '1', '1', '1443');
