INSERT INTO `rec_position` VALUES ('35', '3', '软件工程师（德清乾元）', '后端', '5-8K', '湖州', '不限', '  2年经验  ', '周末双休\n带薪年假\n五险一金\n高温补贴\n年终奖金', '\n软件工程师 (Winform软件方向)岗位要求：1.本科及以上学历，计算机、软件工程、光电或者相关专业；2.熟练使用C#或C++；3.熟悉软件项目开发过程，能规范编写开发技术文档。4.熟悉串口、TCP/IP通讯或图像处理者优先；5.有较好的数理基础，有测控、电子领域实习工作背景的优先； 6.具有优秀的学习能力和钻研精神；有良好的团队合作能力和沟通能力。工作地点：湖州德清县乾元镇\n', '\n软件工程师 (Winform软件方向)岗位要求：1.本科及以上学历，计算机、软件工程、光电或者相关专业；2.熟练使用C#或C++；3.熟悉软件项目开发过程，能规范编写开发技术文档。4.熟悉串口、TCP/IP通讯或图像处理者优先；5.有较好的数理基础，有测控、电子领域实习工作背景的优先； 6.具有优秀的学习能力和钻研精神；有良好的团队合作能力和沟通能力。工作地点：湖州德清县乾元镇\n', '2021-04-04', '1', '1', '331');
