INSERT INTO `rec_position` VALUES ('37', '3', 'C++软件工程师', '嵌入式', '10-15k', '异地招聘', '不限', '  1年经验  ', '年终奖金\n餐饮补贴\n做五休二\n周末双休\n商业保险\n六险一金\n员工旅游\n专业培训\n定期体检\n绩效奖金', '\n岗位职责：1.负责软件项目的需求分析及设计工作，配合项目经理进行技术决策和风险评估，协助项目经理完成项目前期工作计划制定； 2、负责公司产品或项目编码开发及文档编写工作。岗位要求：1. 本科及以上学历，计算机相关专业，熟悉Qt的软件编程，特别是基于Python的开发，一年左右项目经验；2. 有数据库编程和网络编程开发经验；3. 有FFMpeg和（或）OpenCV等第三方视频/图像处理库开发经验;4. 有医疗PACS系统开发及部署经验者优先考虑；5. 爱好编程及软件系统开发，有责任心和好奇心。\n', '\n岗位职责：1.负责软件项目的需求分析及设计工作，配合项目经理进行技术决策和风险评估，协助项目经理完成项目前期工作计划制定； 2、负责公司产品或项目编码开发及文档编写工作。岗位要求：1. 本科及以上学历，计算机相关专业，熟悉Qt的软件编程，特别是基于Python的开发，一年左右项目经验；2. 有数据库编程和网络编程开发经验；3. 有FFMpeg和（或）OpenCV等第三方视频/图像处理库开发经验;4. 有医疗PACS系统开发及部署经验者优先考虑；5. 爱好编程及软件系统开发，有责任心和好奇心。\n', '2021-04-05', '1', '1', '838');
INSERT INTO `rec_position` VALUES ('38', '3', '软件工程师', '后端', '5-8K', '南京', '不限', '  3-4年经验  ', '五险一金\n餐饮补贴\n年终奖金', '\n岗位职责    1、参与医学超声系统运行逻辑设计；    2、医学超声系统显示界面及后台软件的设计与实现；    3、软件测试与维护；    4、编写项目需求文档、技术文档、作业指导书等；    5、其他相关事务。岗位要求    1、软件、计算机相关专业本科或以上学历，有B超、CT软件开发经验者优先；    2、熟悉使用C#或QT中的一种，了解医学影像知识和DICOM通信标准的优先；    3、熟悉面向对象、软件设计模式等知识；    4、熟悉软件测试方法；    5、具备良好的沟通能力，能吃苦耐劳，有强烈的责任心；    6、英语良好者优先；  \n', '\n岗位职责    1、参与医学超声系统运行逻辑设计；    2、医学超声系统显示界面及后台软件的设计与实现；    3、软件测试与维护；    4、编写项目需求文档、技术文档、作业指导书等；    5、其他相关事务。岗位要求    1、软件、计算机相关专业本科或以上学历，有B超、CT软件开发经验者优先；    2、熟悉使用C#或QT中的一种，了解医学影像知识和DICOM通信标准的优先；    3、熟悉面向对象、软件设计模式等知识；    4、熟悉软件测试方法；    5、具备良好的沟通能力，能吃苦耐劳，有强烈的责任心；    6、英语良好者优先；  \n', '2021-04-05', '1', '1', '467');
INSERT INTO `rec_position` VALUES ('39', '3', '软件工程师', '后端', '5-8K', '宣城', '不限', '  无工作经验  ', '专业培训\n年终奖金\n绩效奖金\n员工旅游\n弹性工作', '\n岗位要求： 1、计算机或会计相关专业专科以上学历2.   有2年以上IT领域售前咨询工作经验者优先；3、具备技术开发和项目实施经验者优先；4、优秀的逻辑思维能力和抽象思维能力，擅长概念提炼和需求总结；5、工作条理性强，具有很强的责任心和团队合作精神\n', '\n岗位要求： 1、计算机或会计相关专业专科以上学历2.   有2年以上IT领域售前咨询工作经验者优先；3、具备技术开发和项目实施经验者优先；4、优秀的逻辑思维能力和抽象思维能力，擅长概念提炼和需求总结；5、工作条理性强，具有很强的责任心和团队合作精神\n', '2021-04-05', '1', '1', '1211');
INSERT INTO `rec_position` VALUES ('40', '3', '3D家居-信息技术中心-软件工程师（报表/数据库）', '产品', '10-15k', '沈阳', '不限', '  无工作经验  ', '免费班车\n员工旅游\n年终奖金\n专业培训\n定期体检\n免费食宿', '\n报表开发工程师1、负责报表、BI相关的开发工作及数据仓库的建设工作；   2、负责报表数据质量检验和监控；   3、负责各应用系统间集成对接工作；   4、根据各部门的需求设计和开发相应的管理报表；   5、业务数据分析，根据关键指标进行数据展示任职条件：1、大学专科及以上学历，计算机、软件开发等相关专业2、熟悉SQL语句编程，会编写存储过程、触发器、函数等，使用过帆软、乾润等主流的报表/BI产品；   3、熟悉Sql Server、Oracle、Mysql、DB2的一种或几种；   4、有数据仓库知识和报表开发经验、通过帆软FCRP认证者优先。 5、具有一定的前后台开发能力，有基本的js，css基础，文档能力突出者优先工作时间： 早八晚五，周休一天，法定节假日带薪休息 福利待遇： 免费住宿，免费食堂，免费班车，一年以上员工免费工装，生日礼物，节日礼品，室内体育馆（包括游泳池、6个羽毛球场、10个乒乓球案、健身器材、篮球场等） 乘车方式：一号线地铁到终点十三号街，B口出来乘坐160到西四环开发二路下车，走到十字路口向东走300米到3号门 面试时间：每周一至周六上午9:00-10:00 下午1:30-4:00符合条件者可以直接来公司面试，\n', '\n报表开发工程师1、负责报表、BI相关的开发工作及数据仓库的建设工作；   2、负责报表数据质量检验和监控；   3、负责各应用系统间集成对接工作；   4、根据各部门的需求设计和开发相应的管理报表；   5、业务数据分析，根据关键指标进行数据展示任职条件：1、大学专科及以上学历，计算机、软件开发等相关专业2、熟悉SQL语句编程，会编写存储过程、触发器、函数等，使用过帆软、乾润等主流的报表/BI产品；   3、熟悉Sql Server、Oracle、Mysql、DB2的一种或几种；   4、有数据仓库知识和报表开发经验、通过帆软FCRP认证者优先。 5、具有一定的前后台开发能力，有基本的js，css基础，文档能力突出者优先工作时间： 早八晚五，周休一天，法定节假日带薪休息 福利待遇： 免费住宿，免费食堂，免费班车，一年以上员工免费工装，生日礼物，节日礼品，室内体育馆（包括游泳池、6个羽毛球场、10个乒乓球案、健身器材、篮球场等） 乘车方式：一号线地铁到终点十三号街，B口出来乘坐160到西四环开发二路下车，走到十字路口向东走300米到3号门 面试时间：每周一至周六上午9:00-10:00 下午1:30-4:00符合条件者可以直接来公司面试，\n', '2021-04-05', '1', '1', '1542');
